import React from "react";
import { Link } from "react-router-dom";
import "../css/Body.css";
import SearchBar from "./SearchBar";

function Body() {
  return (
    <div>
      <p>Welcome to my SkyFinder application!</p>
      <p>Find the best deals on flights.</p>
      <SearchBar />
      <br></br>
      <div>
        <Link to="/login">
          <button className="login-btn">Login</button>
        </Link>
      </div>
    </div>
  );
}

export default Body;
